import React, { useState } from "react";
import {
  Container,
  IconContainer,
  MobileContainer,
  Icon,
  CatImg,
  ImgDiv,
  TitleImg,
  Desc,
  Item,
  Title,
} from "./AppStyle";
import Cat from "./cat.jpg";

const App = () => {
  return (
    <Container>
      <MobileContainer>
        <IconContainer>
          <Icon.Arrow />
          <Icon.Switch />
        </IconContainer>
        <ImgDiv>
          <CatImg src={Cat} alt="cat" />
          <TitleImg>Catty</TitleImg>
          <Desc>CatLover</Desc>
        </ImgDiv>
        {/* darkMode */}
        <Item>
          <Icon.Moon />
          <Title>Dark Mode</Title>
        </Item>
        {/* Grid */}

      </MobileContainer>
    </Container>
  );
};

export default App;
